import React from 'react'
import { useNavigate } from "react-router-dom";
import {useState} from 'react'
import '../assets/scss/Register.scss'
import { Grid } from "../assets/UiKit/grid/Gird";
import { Line,Rows } from "../assets/UiKit/Line/Line";

export default function Register() {

    const [registerEmail, setEmail] = useState("");
    const [registerPassWord, setPassword] = useState("");
    const [confirmationPassWord, setConfirmationPassWordPassword] = useState("");
    const [phone_num, setPhone_num] = useState("");
    const [f_name, setF_name] = useState("");
    const [l_name, setL_name] = useState("");
    const [errorMessage, setErrorMessage] = useState("");

    function handlesubmit(e) {
      e.preventDefault();
      registerPassWord === confirmationPassWord
        ? register()
        : setErrorMessage(
            "ERROR: Your password and confirmation password do not match."
          );
    }
    // const  = {
    //   f_name: f_name,
    //   L_name: l_name,
    //   email: registerEmail,
    //   password: registerPassWord,
    //   password_validate: "registerPassWord",
    //   phone_num: phone_num,
    //   bio: "bio"
    //   // bio
    // };
    // const userDetails = {
    //   f_name: "ohad",
    //   L_name: "izraeli",
    //   email: "ohad.izraeli@gmail.com",
    //   password: "123456",
    //   password_validate: "123456",
    //   phone_num: "054-1234567",
    //   bio: "bio"
    // };

    async function register() {
      try {
        const response = await fetch("http://localhost:8000/singup", {
          method: 'POST',
          headers: {
              'Content-Type': 'application/json'
          },
          body: JSON.stringify({
            "email": "test7@gmail.com",
            "password": "122345567dasdadasda82312",
            "password_validate": "122345567dasda82312",
            "f_name": "test6-normal user",
            "l_name": "test6",
            "phone_num": "050-1111111",
            "bio": "???"
                }
          ),
        });
        const data = await response.json();
        console.log(data);
        // localStorage.setItem("token", data.token);


      } catch (e) {
        console.log(e);
      }
    }


  return (
    <div className='RegisterContainer'>
    <Grid>
    <h2>Register User</h2>
        <form className="registerDiv" onSubmit={handlesubmit}>

    <Rows>
        <label>First Name</label>
        <input
          type="text"
          value={f_name}
          onChange={(e) => setF_name(e.target.value)}
        />
        <label>Last name</label>
        <input
          type="text"
          value={l_name}
          onChange={(e) => setL_name(e.target.value)}
        />
        <label>Email</label>
        <input
          type="email"
          value={registerEmail}
          onChange={(e) => setEmail(e.target.value)}
        />
        <label>Phone Number</label>
        <input
          type="phone"
          value={phone_num}
          onChange={(e) => setPhone_num(e.target.value)}
        />
        <label>Password</label>
        <input
          type="password"
          value={registerPassWord}
          onChange={(e) => setPassword(e.target.value)}
        />
        <label>Confirm Password</label>
        <input
          type="password"
          value={confirmationPassWord}
          onChange={(e) => setConfirmationPassWordPassword(e.target.value)}
        />
        <button type="submit"
        handlesubmit={handlesubmit}
        >Register</button>

        <p>{errorMessage}</p>







        </Rows>
        </form> 
        </Grid>
    </div>
  )
}
